SDB fork()
{
  SDB pid;// = create();
  
  if(pid != FORK_FAILURE)  
  {
   //Setting the pid in the Child Process
   _proc[pid].eax = 0;
   // and the pid of child in the Parent Process
   _proc[cur_pid].eax = pid;
  }
	return pid;
}

